let obj = {}
window.jQuery.ajaxSetup({
    headers: {
        'X-CSRF-TOKEN': window.jQuery('meta[name="csrf-token"]').attr('content')
    }
});
obj.get = (url, postData) => {
    return window.jQuery.when(window.jQuery.ajax({
        method: "GET",
        url: url,
        data: postData,
        dataType: "json"
      }))
      .done((rs) => {
          console.log(rs)
      });
}

export default obj;
